exports=async function(a,b,c,d){const{parseContent:e,trimBeforeContent:f}=await require("transcode/parse_content");return e(a,null,{...d,parser:function(a){let b=a.substring(a.indexOf("id=\"content\"")).replace(/^[^>]*>\s*(?:<div[^>]*>.+?<\/div>)?/,"");b=b.substring(0,b.indexOf("</div>"));const c=b.matchAll(/<p data-id="(?<id>\d+)"[^>]*>(?<inner>(?:[^<]|<br\s*\/?>)*)<\/p>/g),d=[];for(let b of c)d.push([parseInt(b.groups.id),b.groups.inner.replace(/<br ?\/?>/g,"\n")]);return d.sort((c,a)=>c[0]-a[0]).map(a=>a[1]).flat()}})};